import React from 'react';
import {Container, Typography, TextField, Button} from '@material-ui/core';
import './CadastroTema.css';

function CadastroTema(){
    return(
        <Container maxWidth='sm' className= 'topo'>
            <form>
                <Typography variant='h3' color='textSecondary' component='h1' align='center'>Formul√°rio para cadastro do tema </Typography>
                    <TextField value='' id='descricao' label='descricao' variant='outlined' name='descricao' margin='normal' fullWidth/>
                    <Button type='submit' variant='contained' color='primary'>
                        Finalizar
                    </Button>
            </form>
        </Container>
    )
}

export default CadastroTema;
